import './GalleryScroll.css'
import StyledImage from './StyledImage';
import Tabs from '@mui/material/Tabs';
import Tab from '@mui/material/Tab';



function GalleryScroll(props) {

    const { images } = props;

    return (
        <Tabs value={0} aria-label="disabled tabs example" variant='scrollable'>
            <Tab label="Active" disabled>
                {images.map((img) => {
                    return (
                        <StyledImage src={img} height={'50vh'} width={'auto'} padding={'30px'}></StyledImage>
                    );
                })}
            </Tab>
        </Tabs>
    );
}

export default GalleryScroll;

